import React from 'react';

function ImagePopup(props) {
    return (
        <article className="popup popup_type_zoomed" id="popup_type_zoomed">
        <div className="popup__zoomed">
            <button type="button" className="popup__button popup__button_type_close" aria-label="close"/>
            <img className="popup__picture" src="#" alt="#"/>
            <p className="popup__caption"></p>
        </div>
    </article>


    );
}

export default ImagePopup;
